function Card({ title, content, picture, link, }) {
    return (
        <div>
            <img src={picture} alt="Apple" width="500" height="333"/>
            <a style={{color: "black"}} href={link} rel="noopener noreferrer" className="card-link">
                <h3>{title}</h3>
            </a>
            <p>{content}</p>
        </div>
    );
}


function MiniCard({ title, content, link, backgroundColor, padding, borderRadius, width, height, textAlign }) {
    return (
        <div style={{
            backgroundColor,
            padding,
            borderRadius,
            width,
            height,
            textAlign,
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
            alignItems: "center"
        }}>
            <a href={link} target="_blank" rel="noopener noreferrer">
                <h3>{title}</h3>
            </a>
            <p>{content}</p>
        </div>
    );
}


function Board({ title, content}) {
    return (
        <div>
            <h3>{title}</h3>
            <p>{content}</p>
        </div>
    )
}

export { MiniCard, Board };
export default Card;
